import { createContext, useState } from 'react';

const loginStatus = createContext();

const IntegerProvider = ({ children }) => {
  const [sharedInteger, setSharedInteger] = useState(0);

  return (
    <loginStatus.Provider value={{ sharedInteger, setSharedInteger }}>
      {children}
    </loginStatus.Provider>
  );
};

export { loginStatus, IntegerProvider };
